#https://github.com/PySimpleGUI/PySimpleGUI/issues/3412#issuecomment-703147574
import PySimpleGUI as sg

def make_window(theme):
    sg.theme(theme)
    layout = [
        [sg.Text('More Buttons from the Web....', font='Default 20')],
        [
            sg.Button(image_data=download, button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0, ),
            sg.Button(image_data=download2, button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0, ),
            sg.Button('My Text', font='Helvetica 12 bold italic', image_data=download3, button_color=('white', sg.theme_background_color()), border_width=0, ),
            sg.Button('More Text', font='Helvetica 12 bold italic', image_data=download4, button_color=('white', sg.theme_background_color()), border_width=0, ),
        ],
        [
            sg.Button(image_data=download3, button_color=('white', sg.theme_background_color()), border_width=0, ),
            sg.Button( image_data=download4, button_color=('white', sg.theme_background_color()), border_width=0, ),
        ],
        [
            sg.Button('I Like', font='Helvetica 12 bold',image_data=grey1, button_color=('black', sg.theme_background_color()), border_width=0, ),
            sg.Button('Nice too!', font='Helvetica 12 bold italic', image_data=grey2, button_color=('black', sg.theme_background_color()), border_width=0, ),
        ],
        [sg.Combo(sg.theme_list(), default_value=theme, enable_events=True, key='-THEMES-')],
        ]

    return sg.Window('Nice Buttons Buddy', layout, finalize=True)

def main():
    window = make_window('Python')
    while True:             # Event Loop
        event, values = window.read()
        if event == sg.WINDOW_CLOSED:
            break
        if values['-THEMES-']:
            window.close()
            window = make_window(values['-THEMES-'])
    window.close()

if __name__ == '__main__':
    #fyi: these are base64 encoded images.
    download = b''
    download2 = b''
    download3 = b''
    download4=b''
    grey1 = b''
    grey2 = b''
    main()